[{"location":"","page":"Home","title":"Home","text":"DocTestSetup = quote\n    using Unitful\n    using TimeseriesTools\nend\nCurrentModule = TimeseriesTools","category":"page"},{"location":"#TimeseriesTools","page":"Home","title":"TimeseriesTools","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for TimeseriesTools.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [TimeseriesTools]","category":"page"},{"location":"#TimeseriesTools.AbstractTimeSeries","page":"Home","title":"TimeseriesTools.AbstractTimeSeries","text":"AbstractTimeSeries{T, N, B}\n\nA type alias for an AbstractDimArray with a time index.\n\n\n\n\n\n","category":"type"},{"location":"#TimeseriesTools.IrregularTimeSeries","page":"Home","title":"TimeseriesTools.IrregularTimeSeries","text":"IrregularTimeSeries\n\nA type alias for a potentially irregularly sampled time series.\n\n\n\n\n\n","category":"type"},{"location":"#TimeseriesTools.MultivariateTimeSeries","page":"Home","title":"TimeseriesTools.MultivariateTimeSeries","text":"MultivariateTimeSeries{T}\n\nA type alias for a multivariate time series (A matrix, with a first Ti dimension and an arbitrary second dimension).\n\n\n\n\n\n","category":"type"},{"location":"#TimeseriesTools.RegularIndex","page":"Home","title":"TimeseriesTools.RegularIndex","text":"RegularIndex\n\nA type alias for a regularly sampled dimension, wrapping an AbstractRange.\n\n\n\n\n\n","category":"type"},{"location":"#TimeseriesTools.RegularTimeIndex","page":"Home","title":"TimeseriesTools.RegularTimeIndex","text":"RegularTimeIndex\n\nA type alias for a tuple of dimensions containing a TimeIndex and any number of other dimensions.\n\n\n\n\n\n","category":"type"},{"location":"#TimeseriesTools.RegularTimeSeries","page":"Home","title":"TimeseriesTools.RegularTimeSeries","text":"RegularTimeSeries{T, N, B}\n\nA type alias for a regularly sampled time series.\n\n\n\n\n\n","category":"type"},{"location":"#TimeseriesTools.TimeIndex","page":"Home","title":"TimeseriesTools.TimeIndex","text":"TimeIndex\n\nA type alias for a tuple containing a time dimension and any number of other dimensions.\n\n\n\n\n\n","category":"type"},{"location":"#TimeseriesTools.UnivariateTimeSeries","page":"Home","title":"TimeseriesTools.UnivariateTimeSeries","text":"UnivariateTimeSeries{T}\n\nA type alias for a time series with one variable (a vector with only a Ti dimension).\n\n\n\n\n\n","category":"type"},{"location":"#TimeseriesTools.Var","page":"Home","title":"TimeseriesTools.Var","text":"Var\n\nA DimensionalData.jl dimension representing the variables of a multivariate time series.\n\n\n\n\n\n","category":"type"},{"location":"#TimeseriesTools.TimeSeries-Tuple{Any, Any, Any}","page":"Home","title":"TimeseriesTools.TimeSeries","text":"TimeSeries(t, v, x)\n\nConstructs a multivariate time series with time t, variable v, and data x.\n\nExamples\n\njulia> t = 1:100;\njulia> v = [:a, :b, :c];\njulia> x = rand(100, 3);\njulia> mts = TimeSeries(t, v, x)\njulia> mts isa Union{MultivariateTimeSeries, RegularTimeSeries}\n\n\n\n\n\n","category":"method"},{"location":"#TimeseriesTools.TimeSeries-Tuple{Any, Any}","page":"Home","title":"TimeseriesTools.TimeSeries","text":"TimeSeries(t, x)\n\nConstructs a univariate time series with time t and data x. Alteratively, use TS(t, x)\n\nExamples\n\njulia> using TimeseriesTools, Unitful;\njulia> t = 1:100\njulia> x = rand(100)\njulia> ts = TimeSeries(t, x)\njulia> ts isa Union{UnivariateTimeSeries, RegularTimeSeries}\n\n\n\n\n\n","category":"method"}]
